\u091c\u0940\u0924.content:
वीरगन्ज : वीरगन्ज महानगरपालिकाको मेयरमा सत्तागठबन्धनका साझा उम्मेदवार राजेशमान सिंहको जीत सुनिश्चित भएको छ। महानगरको जारी मतगणनामा अब गन्न बाँकी रहेको मतभन्दा एमालेका उम्मेदवार विजय सरावगी र जसपाका उम्मेदवार राजेशमान बीचको मतान्तर बढी भएकोले राजेशमानको जीत सुनिश्चित भएको हो। ;

सोमबार बिहान साढे ७ बजेसम्म कुल खसेको ९३ हजार ७ सय ८२ मतमध्ये ७७ हजार ५ सय ७७ मत गणना भइसकेको छ। अब १६ हजार २ सय ५ मत मात्रै गन्न बाँकी छ। ;
यो अवस्थामा राजेशमानले १८ हजार ७ सय ५८ मतको अग्रता लिइसकेका छन्। यसले अब महानगरको मेयरमा राजेशमानको जीत सुनिश्चित देखिएको हो। ;

सोमबार बिहान साढे ७ बजेसम्म ७७ हजार ५ सय ७७ मत गणना हुँदा राजेशमानले ३८ हजार ४ सय ३७ मत पाएका छन् भने उनका निकटतम प्रतिद्वन्द्वी सरावगीले भने १९ हजार ६ सय ७९ मत मात्रै ल्याएका छन्। तेश्रो स्थानमा रहेका राप्रपाका मेयर उम्मेदवार गिरिश गिरीले भने २ हजार ८ सय ५७ मत पाएका छन्। ;

गन्न बाँकी रहेको मतभन्दा राजेशमानको मतान्तर बढी भएसँगै सामाजिक सन्जालमा राजेशमानका समर्थकहरुले जीतको बधाइ र शुभकामना दिन सुरु गरिसकेका छन्। यस्तै वीरगन्ज महानगरको उपमेयरमा पनि गठबन्धनका साझा उम्मेदवार इम्तियाज आलमको जीत पनि  ;सुनिश्चित भएको छ। ;

अब १६ हजार २ सय ५ मत मात्रै गन्न बाँकी रहँदा गठबन्धनबाट कांग्रेसका उम्मेदवार आलमले १८ हजार ३ सय ४७ मतको अग्रता लिइसकेका कारण उनको पनि जीत सुनिश्चित भएको हो। बिहान साढे ७ बजेसम्म ७७ हजार ५ सय ७७ मत गणना हुँदा उपमेयरमा आलमले २४ हजार ९ सय १५ मत पाएका छन् भने उनका निकटतम प्रतिस्पर्धी लोसपका उम्मेदवार पुरुषोत्तमलाल झाले भने ६ हजार ५ सय ६८ मत मात्रै पाएका छन्।

राजविराज : गत निर्वाचनमा झिनो मतअन्तरले पराजित भएका जितेन्द्रप्रसाद गुप्ता कलवार शम्भुनाथ नगरपालिकामा नगर प्रमुखमा निर्वाचित भएका छन्। ; ;  ;नेकपा एकीकृत समाजवादीतर्फबाट कलवारले ५ हजार ३९२ मत प्राप्त गरी नगर प्रमुखमा निर्वाचित भएको निर्वाचन अधिकृतको कार्यालय शम्भुनाथले जनाएको छ।
 ; ;  ;
निकटतम प्रतिद्वन्द्वी रहेका कांग्रेसका दिपेन्द्रकुमार चौधरीले ४ हजार १४३ मत ल्याएका छन्। यसअघि २०७४ को निर्वाचनमा नेकपा (एमाले)बाट चुनाव लडेका कलवार ४४ मत अन्तरले पराजित भएका थिए। गत स्थानीय तहको निर्वाचनमा कांग्रेसका योगेन्द्र चौधरीले २ हजार ७७८ मत ल्याई गुप्तालाई पराजित गरेका थिए। योगेन्द्र चौधरी अस्वस्थ्य रहने गरेपछि कांग्रेसले दिपेन्द्रलाई उम्मेदवार बनाएको हो।
 ; ;  ;
एकीकृत समाजवादीकी अनिताकुमारी चौधरीले उपप्रमुखमा ४ हजार ९९८ मत ल्याएर विजयी भएकी छन्। निकट्तम प्रतिद्वन्द्वी कांग्रेसकी जलपनाकुमार सरदारले ४ हजार २७१ मत ल्याइन्। कांग्रेसले उपप्रमुखमा जल्पनालाई उम्मेदवार बनाए पछि गत निर्वाचनमा कांग्रेसबाट निर्वाचित उपप्रमुख कविताकुमारी सरदार लोसपाबाट उम्मेदवार बनेकी थिइन्। कविता १ हजार १८८ मत ल्याएर छैठो स्थानमा रहिन्।
 ; ;  ;
वडा अध्यक्षमा एकीकृत समाजवादी र कांग्रेसले ५/५, जसपा र लोसपाले १/१ वडा अध्यक्षमा जीत हासिल गरेको छ।
एकीकृत समाजवादीबाट वडा नम्बर ४ मा विजयकुमार साह, ८ मा इन्द्रकान्त चौधरी, ९ मा प्रभु मलाहा, ११ मा राजकुमार साह र १२ मा संजयकुमार साह वडा अध्यक्षमा निर्वाचित भएका छन्। ;

यस्तै कांग्रेसबाट वडा नम्बर १ मा जिवछ साह, २ मा दुर्गानन्द भगत, ३ मा नविनकुमार चौधरी, ५ मा जामुनप्रसाद चौधरी र ६ मा सचेन्द्र प्रसाद चौधरी वडा अध्यक्ष निर्वाचित भएका छन्। वडा नम्बर ७ मा जसपाका गोपालप्रसाद चौधरी र वडा १० मा लोसपाका धर्मेन्द्र भनिने रामाकान्त मण्डल विजयी भएका छन्।
 ; ;  ;
सप्तरीमा हालसम्म घोषित परिणाम अनुसार सप्तरीमा कांग्रेसले ३, एमालेले २, लोसपा, जनमत र नेकपा (एकीकृत समाजवादी)ले १/१ स्थानीय तहमा जीत हासिल गरेको छ।

राजविराज : सप्तरी जिल्लाको सबैभन्दा दक्षिण–पश्चिम रहेको बलान बिहुल गाउँपालिमा जनमत पार्टीले अध्यक्ष, उपाध्यक्ष जितेको छ।
 ; ;  ;
सप्तरीको दोस्रो पालिकामा जीत निकालेको जनमत पार्टीका तर्फबाट खेमचन्द्र यादव अध्यक्ष र रेणु यादव उपाध्यक्षमा निर्वाचित भएका छन्। ;

जीतका लागि खेमचन्द्र यादवले २ हजार ९९४ मत ल्याएका छन्। निकटतम प्रतिद्वन्द्वी नेपाली कांग्रेसका नबीनकुमार झाले २ हजार २४७ मत ल्याए। यस अघि २०७४ मा कांग्रेसबाट टिकट नपाएपछि नेपाली जनता दलबाट उठेका झाले त्यसबेला १ हजार १२३ मत र झासँगै उपाध्यक्षमा उठेकी आशादेबी मण्डलले ९१४ मत ल्याएर चौथो स्थानमा रहेका थिए।  ;
 ; ;  ;
त्यसपछि कांग्रेसमै सक्रिय रहेका नबिन झा र आशादेवी मण्डललाई पार्टी कार्यकर्ताबाटै असहयोग हुँदा पराजित हुनु परेको झाले बताए। गत निर्वाचनमा कांग्रेसले जितेन्द्र यादवलाई अध्यक्ष र अनितादेबी साहलाई उपाध्यक्षमा उम्मेदवारी दिएपछि झा र मण्डल जनता दलबाट टिकट लिएर उठेका थिए। ;

गत निर्वाचनमा निर्वाचित जसपाका दयानन्द गोइत तेस्रो भएका छन्। मतदाता बढेकोमा उनले पुरानै मत सुरक्षित गर्न नसक्दा पराजय बेहोर्नुपरेको छ। दयानन्दले गत निर्वाचनमा २ हजार २३८ मत ल्याउँदा अध्यक्ष निर्वाचित भएका थिए। यसपटक उनले २ हजार २०३ मत मात्र ल्याए। ;
 ; ;  ;
एमालेबाट अरुणकुमार गोइतले २ हजार १७२ मत ल्याएर चौथो भए। गत वर्ष एमालेबाट उम्मेदवारी दिएका अशोककुमार यादवले एमालेबाट टिकट नपाएपछि मनोनयनको दिन एकीकृत समाजवादीमा प्रवेश गरेर उम्मेदवारी दिए। उनले गत निर्वाचनको भन्दा निकै कम ३१९ मत मात्र ल्याउन सके।

गाउँपालिकाको उपाध्यक्षमा जनमतकै रेणु यादवले २ हजार ६९० मत ल्याएर विजयी भइन्। उनका निकटतम प्रतिद्वन्द्वी कांग्रेसकी आशादेवी मण्डलले २ हजार ३०४ मत ल्याइन्। ;

वडा अध्यक्षमा कांग्रेसले ३, जनमतले २ र एमालेले १ वडा अध्यक्षमा जीत हासिल गरेको छ। कांग्रेसबाट वडा २ मा ५०५ मत ल्याएर इनद्रदेब यादव, वडा ४ मा ७४१ मत ल्याएर लक्ष्मीनारायण झा, वडा ५ मा ४३८ मत ल्याएर विन्देश्वर यादव वडा अध्यक्षमा विजयी भएका छन्। वडा अध्यक्ष झा अध्यक्षमा निकटतम प्रतिद्वन्द्वी रहेका कांग्रेसका नबिन झाका भाइ हुन्।

जनमत पार्टीबाट वडा नम्बर १ मा ३९५ मत ल्याएर रामकुमार यादव र वडा नबर ३ मा ८१९ मत ल्याएर राजकिशोर यादव वडा अध्यक्ष निर्वाचित भएका छन्। एमालेबाट वडा ६ मा निर्वाचित वडा अध्यक्ष सुर्यकुमार दासले ६७१ मत ल्याए। गत स्थानीय तहको निर्वाचनमा समेत एमालेबाट दास ५६८ मत ल्याएर वडा अध्यक्षमा निर्वाचित भएका थिए।
 ; ;  ;
सप्तरीमा हालसम्म घोषित ११ स्थानीय तहको परिणाम अनुसार कांग्रेसले ४, एमाले र जनमतले २-२, जसपा, लोसपा, नेकपा (एकिकृत समाजवादी)ले १/१ स्थानीय तहमा जित हासिल गरेको छ। बाँकी रहेको ७ स्थानीय तहमा मतगणना भइरहेको छ।

धनकुटा : स्थानीय तह निर्वाचनको पछिल्लो मत परिणाम अनुसार महालक्ष्मी नगरपालिका र पाख्रिवास नगरपालिकामा गठबन्धन र धनकुटा नगरपालिका र सहिदभूमि गाउँपालिकामा नेकपा एमालेका उम्मेदवार निर्वाचित भएका छन्। ;

जिल्लाको सबै सात स्थानीय तहको अन्तिम नतिजा सार्वजनिक भइसकेको छ। जसमा गठबन्धन चार र नेकपा एमाले तीन स्थानीय तहमा विजयी भएका छन्। यसअघि साँगुरीगढी गाउँपालिका र छथरजोरपाटी गाउँपालिकामा गठबन्धन र चौविसे गाउँपालिकामा नेकपा एमालेले जित हासिल गरेको थियो। ;

पाख्रिवास नगरपालिकाको प्रमुखमा गठबन्धनकोतर्फबाट उम्मेदवार बनेका नेपाली कांग्रेसका ज्ञानबहादुर गुरुङ निर्वाचित भएका छन्। उनले निकटम प्रतिद्वन्द्वी नेकपा एमालेका भीम राईलाई पराजित गरे। मेयरमा विजयी गुरुङले ५ हजार ४९८ मत प्राप्त गर्दा एमालेका भिम राइले ५ हजार ५३ मत प्राप्त गरे। उपप्रमुखमा एमालेकि नम्रता देउजाले बाजी मारिन्। देउजाले ५ हजार ६२ मत प्राप्त गर्दा गठबन्धनका उम्मेदवार माओवादीका ओमप्रकाश निरौलाले ४ हजार ६४१ मत प्राप्त गरे। पाख्रिवास नगरपालिकाको वडा नं. २, ३, ७, ९ र १० वडा नेकपा एमाले र वडा नं. १, ४, ५, ६ र ८ नं. वडामा गठबन्धनका उम्मेदवार विजयी भए। ;

महालक्ष्मी नगरपालिकाको प्रमुखमा गठबन्धनका ध्रुवराज राय निर्चाचित भएका छन्। रायाले नेकपा एमालेबाट उम्मेदवार वनेका दिपक वुढाथोकीलाई १ हजार ३५ मतको फराकिलो अन्तरले पराजित गरेका थिए। विजयी रायले ५ हजार ८ सय ७ र पराजित वुढाथोकीले ४ हजार ७ सय ७२ मत प्राप्त गरे। त्यस्तै उपमेयरमा गठबन्धनको उम्मेदवार प्रेम खड्कालाई ६ सय ७५ मतले पराजित नेकपा एमालेकी मञ्जुकुमारी अधिकारी विजयी भइन्। उनले ५ हजार १ सय ६ मत प्राप्त गरिन्। भने उनका निकटम प्रतिद्वन्द्वी खड्काले ४ हजार ४ सय ३१ मत प्राप्त गरे। त्यस्तै महालक्ष्मी नगरपालिकाको वडा नं. १, ४, ८, ९ वडा नेकपा एमाले र वडा नं. २, ३, ५, ६, ७ वडा गठबन्धनका उम्मेदवार विजयी भए। ;

नेकपा एमालेका उम्मेदवार चिन्तत तामाङ धनकुटा नगरपालिका प्रमुखमा निर्वाचित भएका छन्। उनले निकटम प्रतिद्वन्द्वी गठबन्धनको तर्फबाट उम्मेदवार बनेका नेपाली कांग्रेसका दिनेश राईलाई १४ मतको झिनो अन्तरले पराजित गर्दै तामाङ नगरप्रमुखमा निर्वाचित भएका छन्। तामाङले ७ हजार ६ सय ६६ र पराजित राईले ७ हजार ६ सय ५२ मत प्राप्त गरे। त्यस्तै उपमेयरमा नेकपा एमालेकै भीम देवी खनाल निर्वाचित भइन्। उनले गठबन्धनको तर्फबाट उम्मेदवार वनेका नेकपा माओवादी केन्द्रका गणेश बहादुर विष्टलाई ४ सय ८७ मतले पराजित गरिन्। उपमेयरमा निर्वाचित खनालले ७ हजार १ सय ९६ र विष्टले ६ हजार ६ सय २९ मत प्राप्त गरे। धनकुटाको वडा नं. ३, ५, ६, ७ र १० वडा गठबन्धनले र वडा नं. १, २, ५, ८ र ९ वडामा नेकपा एमालेका उम्मेदवार विजयी भए। ;

यस्तै सहिदभूमि गाउँपालिमा पनि नेकपा एमालेका उम्मेदवारले विजय हासिल गरेको छ। निवर्तमान अध्यक्ष समेत रहेका नेकपा एमालेका मनोज राईले गठबन्धनको तर्फबाट उम्मेदवार वनेका नेकपा एकिकृत समाजवादीका जीतवहादुर राईलाई १ सय ८७ मतान्तरले  ;पराजित गर्दै अध्यक्षमा पूनः निर्वाचित भएका हुन्। विजयी मनोज राईले ४ हजार २ सय १४ र उनका निकटम प्रतिद्वन्द्वी जीतवहादुरले ४ सय २७ ले प्राप्त गरे।

त्यस्तै सोही गाउँपालिकाको पूनः उपाध्यक्षमा निवर्तमान उपाध्यक्ष समेत रहेकी नेकपा एमालेकी रत्नेश्वरी राई निर्वाचित भइन्। उनले गठबन्धनको तर्फबाट उम्मेदवार वनेका नेपाली कांग्रेसका तोर्णबहादुर खड्कालाई १ हजार ३ सय १ मतले पराजित गरिन्। उपाध्यक्षमा विजयी राईले ४ हजार ६ सय २२ र उनका निकटम प्रतिद्वन्द्वी खड्काले ३ हजार ३ सय ७१ मत प्राप्त गरे। सो गाउँपालिकाको वडा नं १, ४ र ५ गठबन्धनले र २, ३, ६ र ७ वडा नेकपा एमालेका उम्मेदवार विजयी भए। ;

गौशाला : मधेस प्रदेशका आन्तरिक मामिला तथा संचारमन्त्री भरतप्रसाद साहले मतदान गरेको वडामा वडाअध्यक्षरुपमा नेपाली कांग्रेसका उम्मेदवारले विजयी हासिल गरेका छन्। ;

मन्त्री साहको गृहनगर गौशाला नगरपालिका वडा नं. ६ फुलकाहामा कांग्रेसका उम्मेदवार रामस्वार्थ यादवले ६३७ मत ल्याएर विजयी भएका हुन। ;

यादवले आफ्ना निकटम प्रतिद्वन्द्वी नेकपा माओवादी केन्द्रका उम्मेदवार चन्द्रप्रभा यादवलाई २२ मतले पराजित गरेका हुन्।
 ;
गौशाला नगरपालिकाकामा माओवादीको गढ मानिएको वडा नं. ६ फुलकाहामा माओवादी पराजय व्यहोरेपछि विभिन्न टिकाटिप्पणीहरु आउन थालेका छन्।

नेकपा माओवादी केन्द्रले गौशाला नगरपालिकाको उपप्रमुख पदमा मन्त्री साहकी भाईवुहारी जनकदुलारी साह उम्मेदवारी दिएका हुन्।

तनहुँ : दश स्थानीय तह रहेको तनहुँमा हालसम्म सात पालिकाको अन्तिम मत परिणाम सार्वजनिक भएको छ। बाँकी तीन पालिकामध्ये व्यास नगरपालिका बाहेक अन्य दुई पालिकामा मतगणना भइरहेको छ। सार्वजनिक मत परिणाम अनुसार नेकपा एमालेले चार, कांग्रेसले दुई र माओवादी केन्द्रले एक पालिकामा विजय हासिल गरेको छ।

जिल्लाको बन्दिपुर गाउँपालिकाको अध्यक्षमा एमाले र उपाध्यक्षमा कांग्रेस विजयी भएको छ। कडा प्रतिष्पर्धाकाबीच एमालेका सुरेन्द्र थापा अध्यक्षमा र कांग्रेसकी पञ्चमाया गुरुङ उपाध्यक्षमा विजयी भए। अध्यक्षमा विजयी थापाले ३ हजार २२९ मत प्राप्त गर्दा निवर्तमान अध्यक्ष पुर्णसिं थापाले ३ हजार १६६ मत पाएका छन्। ;

उपाध्यक्षमा निवर्तमान उपाध्यक्ष करुणा गुरुङ दुई मतले पछाडि परिन्। कांग्रेसकी पञ्चमायाले ३ हजार २७ मत पाउँदा करुणाले ३ हजार २५ मत पाएकी छन्।

भिमाद नगरपालिकामा गठबन्धनलाई पराजित गरी नेकपा एमाले विजयी भएको छ। नेपाली कांग्रेस र एकीकृत समाजवादीको गठबन्धनलाई पराजित गरी नगरपालिकाको प्रमुख तथा उपप्रमुख दुवै पदमा एमाले विजयी भएको हो। ;
प्रमुखमा दधिराज सुवेदी २ हजार २७२ मतान्तरले विजयी भए। सुवेदीले ८ हजार १२८ मत ल्याउँदा  ;उनका निकटतम प्रत्याशी काजिमान श्रेष्ठले ५ हजार ८५६ मत पाए। त्यस्तै उपप्रमुखमा शारदा खनाल दोहोरिएकी छिन्। खनालले ७ हजार ६६७ मत पाइन् भने उनका प्रतिद्धन्द्धी कांग्रेसका मिलन आलेले ७ हजार २०५ मत ल्याए।

आँबुखैरेनी गाउँपालिकाको अध्यक्ष र उपाध्यक्ष दुवै पद नेकपा (माओवादी) केन्द्रले जितेको छ। गाउँपालिकाको अध्यक्षमा शुक्र चुमान र उपाध्यक्षमा दुर्गा अर्याल विजयी भएका हुन्। अध्यक्ष चुमान ३ हजार ९४० मत प्राप्त गरी विजयी भएका छन्। प्रतिस्पर्धी नेपाली काङ्ग्रेसका गिरबहादुर थापाले दुई हजार दुई सय ३० मत प्राप्त गरे। पराजित थापा निवर्तमान गाउँपालिका अध्यक्ष हुन्। उपाध्यक्षमा अर्याल २ हजार ४ मत प्राप्त गरी विजयी हुदाँ प्रतिस्पर्धी नेपाली काङ्ग्रेसकी पवित्रा गौलीले २ हजार १ ८३ मत प्राप्त गरेकी थिइन्।

देवघाट गाउँपालिकाको अध्यक्षमा गठबन्धनका उम्मेदवार नेपाली काङ्ग्रेसका तिलबहादुर थापा विजयी भएका छन्। उपाध्यक्षमा नेकपा (माओवादी) केन्द्रका भुवनसिं गुरुङ विजयी भए। अध्यक्षमा विजयी थापाले ४ हजार ३०६ मत प्राप्त गर्दा प्रतिस्पर्धी नेकपा (एमाले) का दुर्गबहादुर थापाले ३ हजार ४८३ मत पाएका थिए। पराजित थापा पनि निवर्तमान पालिका अध्यक्ष हुन्। त्यस्तै, उपाध्यक्षमा विजयी गुरुङले ३ हजार ७२१ मत प्राप्त गरे। प्रतिस्पर्धी नेकपा (एमाले) का सावित्री न्यौपानेले ३ हजार ४६७ मत पाइन्।

घिरिङ गाउँपालिकाको अध्यक्ष र उपाध्यक्ष नेकपा एमालेले जितेको छ। गठबन्धनका उम्मेदवारलाई पराजित गर्दै अध्यक्ष र उपाध्यक्ष दुवैमा एमालेले जित हासिल गरेको हो। गाउँपालिकाको अध्यक्षमा होमबहादुर थापाले ४ हजार  ;३१ मत पाए। उनका प्रतिस्पर्धी नेपाली काङ्ग्रेसका गङ्गा कुमालले ३ हजार ५५४ मत ल्याएका थिए। उपाध्यक्षमा नेकपा एमालेकै राधादेवी अधिकारी चार हजार चार सय ८१ मत प्राप्त गरी विजयी हुँदा नेपाली काङग्रेस र नेकपा एकीकृत समाजवादीको गठबन्धन तर्फबाट उपाध्यक्षका उम्मेदवार पूर्णबहादुर थापाले २ हजार ७४७ मत प्राप्त गरेका थिए। ;

त्यस्तै, म्याग्दे गाउँपालिकाको अध्यक्षमा नेकपा एमालेका श्रीप्रसाद श्रेष्ठ विजयी भएका छन्। उपाध्यक्षमा नेपाली काङ्ग्रेसका बालकृष्ण घिमिरे विजयी भएका हुन्। अध्यक्षमा निर्वाचित श्रीप्रसाद श्रेष्ठ ७१८ मतान्तरले विजयी हुन्। श्रेष्ठले ४ हजार ९५० मत प्राप्त गर्दा नेपाली काङ्ग्रेसका मायादेवी रानाले ४ हजार २३२ मत प्राप्त गरिन्। पराजित राना निवर्तमान गाउँपालिका अध्यक्ष हुन्। उपाध्यक्षमा काङ्ग्रेसका बालकृष्ण घिमिरेले ५ हजार ३९ मत प्राप्त गरे भने एमालेका रत्नादेवी घिमिरेले ४ हजार २०० मत प्राप्त गरिन्। विजयी घिमिरे दोस्रो कार्यकालका लागि उपाध्यक्षमा दोहोरिएका हुन्।

रिसिङ गाउँपालिकाको अध्यक्ष र उपाध्यक्ष दुवै पद कांग्रेसले जितेको छ। आइतबार दिउँसो सार्वजनिक अन्तिम मत परिणाम अनुसार अध्यक्षमा राजेन्द्रकृष्ण श्रेष्ठ र उपाध्यक्षमा गिनुमाया थापा विजयी भएका हुन्। श्रेष्ठ र थापा दोस्रो कार्यकालका लागि दोहोरिएका हुन्।

जिल्लाको शुक्लागण्डकी नगरपालिका र भानु नगरपालिकामा मतगणना भइरहेको छ। शुक्लागण्डकीमा आजै  ;अन्तिम मत परिणाम आउने अनुमान गरिएको छ। कुल २५ हजार ७४७ मत खसेको शुक्लागण्डकीमा १९ हजार ७५१ मत गणना हुदाँ नेपाली कांग्रेसका प्रमुख उम्मेदवार कृष्णराज पण्डितले  ;१ हजार ४७३ को अग्रता लिएका छन्। पण्डितले ९ हजार २३१ मत प्राप्त गर्दा एमालेका मुक्तिनाथ तिम्सिनाले ७ हजार ७५८ मत ल्याएका छन्। ;

उपप्रमुखमा गठबन्धनबाट माओवादी केन्द्रका खुमबहादुर वि.कले ७ हजार ७५८ र एमालेकी फूलमाया वाग्लेले ७ हजार ५४७ मत पाएकी छिन्। भानु नगरपालिकामा पनि प्रमुखमा कांग्रेसका उम्मेदवारले अग्रता लिएका छन्। व्यास नगरपालिकामा भने मत गणना सुरु नै भएको छैन। गएको शुक्रबार मतदानको क्रममा वडा नं ८ रिस्तीमा उम्मेदवार कुटाकुट भएपछि निर्वाचन आयोगले मतदान कार्य स्थगित गरी जेठ ०४ गते बुधबारलाई पुनः मतदान गर्न निर्देशन दिएको छ।  ;

फिदिम : पाँचथरको तुम्बेवा गाँउपालिकाको अध्यक्षमा नेपाली कांग्रेसका बाबुराम खड्का र उपाध्यक्षमा माओवादी केन्द्रका खड्ग सम्बाहम्फे निर्वाचित भएका छन्। कांग्रेस तुम्बेवाका सभापति समेत रहेका खड्का निकटतम प्रतिद्वन्द्वी नेकपा (एमाले)का गोबिन्दबहादुर तामाङलाई चार सय सात मतान्तरले पछि पार्दै खड्का पालिका अध्यक्षमा निर्वाचित भएका हुन्।  ;
उपाध्यमा माओवादी केन्द्रका खड्गबहादुर सम्वाहाम्फे निर्वाचित भएका छन्। यो पालिकामा २०७४ सालको स्थानीय निर्वाचनबाट अध्यक्ष पदमा कांग्रेसका होमप्रसाद थापा र उपाध्यक्षमा एमालेका धन साँवा विजयी भएका थिए।

नेपाली कांग्रेस, माओवादी केन्द्र र नेपाल कम्युनिष्ट पार्टी एकीकृत समाजवादीको गठवन्धन थियो। यस्तै एमालेले राप्रपा र जनता समाजवादी पार्टिसँग तालमेल गरेर चुनाव लडेको थियो।  ;
 ;

वीरगन्ज : वीरगन्ज महानगरपालिका वडा नम्बर ३१ को वडा अध्यक्षमा नेकपा एमालेका जीतेन्द्र यादव विजयी भएका छन्। वीरगन्ज महानगरमा यो एमालेको पहिलो जीत हो। ;

यसअघि २ वटा वडाको अन्तिम नतिजा आउँदा दुबै वडा जसपाले जितेकोमा वडा नम्बर ३१ मा जीत हात पार्दै महानगरमा एमालेले पहिलो सफलता प्राप्त गरेको हो।  ;

मङगलबार बिहान सकिएको वडा नम्बर ३१ को मतगणनाको अन्तिम परिणाम अनुसार वडा अध्यक्षमा एमालेका यादव विजयी भएका हुन्। ;

यादव १३०७ मतका साथ वडा अध्यक्षमा निर्वाचित भएका हुन्। उनका निकटतम प्रतिद्वन्द्वी जसपाका १२७३ मत मात्रै प्राप्त गरे। यसअघि वडा अध्यक्षमा जितेका नेपाली कांग्रेसका उम्मेदवार चुमनदास चौधरी भने ५४९ मतका साथ तेश्रो स्थानमा रहे।  ;

यसअघि २०७४ को निर्वाचनमा उक्त वडामा कांग्रेसका चुमनदास चौधरी ७६५ मतका साथ निर्वाचित भएका थिए।

दैलेख : संविधान जारी भएपछि पहिलोपटक २०७४ मा भएको स्थानीय तह निर्वाचनमा दैलेखको नारायण नगरपालिकामा एमालेले जीत हासिल गर्यो। दोस्रोपटक सम्पन्न निर्वाचनमा पनि नगरमा एमालेले आफ्नो गढ कायम राखेको छ। सदरमुकाम समेत रहेको यो नगरमा यसपटक एमालेले सत्ता गठबन्धनको सामना गर्नुपर्‍यो। यद्धपि सहजै जीत हासिल गर्‍यो। ;

नगरपालिकाको मेयरमा एमालेका लोमन शर्मा निर्वाचित भएका छन्। एमालेका शर्माले सत्ता गठबन्धनबाट मेयरको उम्मेदवार बनेकी नेपाली कांग्रेसका निर्मलाकुमारी खड्का थापा ७९ मतान्तरले पराजित गरे। एमालेबाट मेयरमा निर्वाचित शर्माले ५४३६ मत प्राप्त गरेका छन्। गठबन्धनबाट उम्मेदवार बनेकी कांग्रेसका थापाले ५३५७ मत प्राप्त गरिन्। ;

उपमेयरमा एमालेकी तप्ताकुमारी खड्काले गठबन्धनका उम्मेदवारलाई १८३५ मतसहित फराकिलो मतान्तरमा पराजित गरिन्। यहाँ गठबन्धनको तर्फबाट नेपाल कम्युनिष्ट पार्टी (एकिकृत समाजबादी) की सावित्री मल्ल उपमेयरको उम्मेदवार बनेकी थिइन्। २०७४ को स्थानीय तह निर्वाचनमा नेकपा एमालेबाट उपमेयरमा निर्वाचित मल्ल एमाले विभाजन पनि एकीकृत समाजबादीमा लागेकी थिइन्।  ;मेयरमा निर्वाचित एमालेकी खड्काले ५६७३ मत प्राप्त गरिन्। यस्तै उपमेयरमा पराजित एकीकृत समाजवादीकी मल्लले ३८३८ मत पाइन्। ;

११ वटा वडा रहेको यो नगरमा एमालेले ७ वटा वडामा जित हासिल गरेको छ भने नेपाली कांग्रेसले ३ वटा वडामा जितेको छ। नगरको वडा नम्बर १ मा कांग्रेसका सन्देशकुमार श्रेष्ठ, २ मा एमालेका रेशमबहादुर थापा, ३ मा एमालेका चन्द्रप्रसाद उपाध्याय, ४ मा कांग्रेसका चन्द्रबहादुर कटुवाल वडाध्यक्षमा निर्वाचित भएका छन्। ;

यस्तै वडा नम्बर  ;५ एमालेका ऐमान सिंह थापा, ६ मा एमालेका जनकप्रसाद न्यौपाने, ७ मा एमालेका खड्गबहादुर शाही, ८ मा एमालेका गोपाल कुमार वि.सी., ९ मा नेपाली कांग्रेसका महेन्द्रविक्रम खड्का, १० मा एमालेका लालबहादुर बस्नेत र ११ मा कांग्रेसका दीर्घबहादुर मल्ल वडाध्यक्षमा निर्वाचित भएका छन्। नारायण नगर एमाले जिल्ला अध्यक्ष एवं प्रतिनीधि सभा सांसद रविन्द्रराज शर्माको गृह पालिका हो। ;

सरुमारानी (प्यूठान) : सरुमारानी गाउँपालिकामा एमालेका झगबहादुर विश्वकर्मा विजयी भएका छन्। उनी दोस्रो कार्यकालका लागि पूनः निर्वाचित भएका हुन्।

सोमबार बिहान सम्पन्न मतगणना अनुसार उनी झिनो मतान्तरले विजयी भएका हुन्। विश्वकर्माले ४ हजार २ सय ८० र उनका प्रतिस्पर्धी कांग्रेसका मुकुन्दराज शर्माले ४ हजार १ सय ९४ मत लिएका छन्। ;

उपाध्यक्षमा एमालेकी बसन्ता खड्का ४ हजार ३ सय ९४ मत लिएर विजयी भएकी छन्। उनको प्रतिस्पर्धी गठबन्धनका गुप्तबहादुर रानाले ३ सय ९ सय ४७ मत लिएका छन्। ६ वटा वडाहरुमध्ये १ र ५ कांग्रेसले जितेको छ। अरु सबै एमालेले जितेको छ। ;

धनकुटा: जिल्लाको सात स्थानीय तहमध्ये तीन स्थानीय तहको अन्तिम मत परिणाम सार्वजनिक भएको छ। तीन तहमध्ये साँगुरीगढी र छथरजोरपाटी गाउँपालिकामा गठबन्धनका उम्मेदवार विजयी भएका छन्। चौविसे गाउँपालिकामा नेकपा एमालेका उम्मेदवार विजयी भएका छन्।  ;

साँगुरीगढी गाउँपालिकाको अध्यक्षमा सत्ता गठबन्धनतर्फबाट उम्मेदवार बनेका नेपाली कांग्रेसका जीतेन्द्र राई विजयी भएका छन्। उनले निकटम प्रतिद्वन्द्वी नेकपा एमालेका कुमार जंग याखालाई ५ सय ७१ मतले पराजित गरे। अन्तिम मत परिणामअनुसार अध्यक्षमा विजय भएका राईले ५ हजार ३ सय ९९ र उनका प्रतिद्वन्द्वी याखाले ४ हजार ८ सय २८ मत प्राप्त गरेका थिए। ;

अघिल्लो २०७४ सालको स्थानीय तह निर्वाचनमा पनि यी दुई उम्मेदवारबीच प्रतिस्पर्धा भएको थियो। जसमा एमालेका कुमारजंग याखाले ११ सय १६ मत बढी ल्याएर बाजी मारेका थिए। त्यति बेला याखाले ४ हजार ४ सय ४९ र जितेन्द्र राईले ३ हजार ३ सय ३३ मत ल्याएका थिए। यो चुनावमा भने यी दुई बीचको मतान्तर ५ सय ७१ हुन पुग्यो। जसमा कांग्रेसका राईले बाजी मार्न सफल भए। ;

गाउँपालिकाको उपाध्यक्षमा नेकपा एमालेको उम्मेदवार मुना राई विजयी भइन्। उनले गठबन्धनतर्फबाट उम्मेदवार बनेका जसपाका लिलाराज लावतीलाई ५ सय १५ मतले पराजित गरिन्। विजयी राईले ४ हजार ६ सय ५० र लावतीले ४ हजार १ सय ३६ प्राप्त गरे।  ; ;

साँगुरीगढी गाउँपालिकाको कुल १० वडामध्ये ६ वडामा नेकपा एमाले र ४ वडामा गठबन्धनका उम्मेदवार विजयी बने। नेकपा एमालेतर्फबाट वडाध्यक्षको उम्मेदवार बनेका वडा नं. १ मा गोविन्द लिम्बू, वडा नं. ४ मा जीवनकुमार लिम्बू, वडा नं. ७ मा पूर्णप्रसाद राई, वडा नं ८ मा हृदयनारायण राई, वडा नं. ९ मा जीतबहादुर राई र वडा नं. १० मा एकबहादुर राई विजयी भए। त्यस्तै गठबन्धनबाट वडाध्यक्षको उम्मेदवार बनेका २ नं. वडामा योगेन्द्रबहादुर इङ्नाम (लिम्बू), वडा नं. ३ मा टेकप्रसाद लिम्बू, वडा नं ५ मा खड्गबहादुर लिम्बू र वडा नं. ६ मा यमप्रकाश मगर विजयी भए। ;
 ;
यसै गरी चौविसे गाउँपालिकाको अध्यक्ष र उपाध्यक्षमा नेकपा एमालेको उम्मेदवार विजयी भएका छन्। अध्यक्षमा गठबन्धनका उम्मेदवार दलबहादुर मगरलाई १ हजार ४७ मतले पराजित गर्दै एमालेका उम्मेदवार राजकुमार लिम्बू विजयी भए। उनले ५ हजार ३५ र मगरले ३ हजार ९ सय ९१ मत प्राप्त गरे। त्यस्तै उपाध्यक्षमा नेकपा एमालेकी उम्मेदवार टंक माया पाङ्मी मगरले मगर गठबन्धनका मंगलकुमार लिम्बूलाई ९ सय ९५ मत पराजित गर्दै विजयी भइन्। ;

विजयी मगरले ४ हजार ९ सय ८३ र पराजित लिम्बूले ३ हजार ९ सय ८८ मत प्राप्त गरे। गाउँपालिकाको वडामा पनि नेकपा एमालेकै वर्चश्व भएको छ। नेकपा एमालेको तर्फबाट वडाध्यक्षम उम्मेदवार बनेका वडा नं. २ मा एनोज तुम्सा, वडा नं. ३ मा मदन तुम्सा, वडा नं. ४ मा लोकेन्द्र मगर, वडा नं. ५ मा आशिष लिम्बु, वडा न.. ८ मा धनकुमार लिम्बु विजयी भए। त्यस्तै गठबन्धनको तर्फबाट वडाध्यक्षमा उम्मेदवार वनेका वडा नं. १ मा दिपकुमार श्रेष्ठ, वडा नं. ६ मा आशिष लिम्बू र वडा नं. ७ मा रुद्रप्रसाद चेम्जोङ्ग (लिम्बू), विजयी भए। ;

यस्तै छथरजोरपाटी गाउँपालिकाको अध्यक्ष-उपाध्यक्षसहित अधिकांश वडामा गठबन्धनका उम्मेदवारहरु विजयी भएका छन्। गाउँपालिकाको अध्यक्षमा गठबन्धनतर्फबाट उम्मेदवार बनेका नेपाली कांग्रेसका छत्रबहादुर सुब्बा विजयी भए। उनले गाउँपालिकाको निवर्तमान अध्यक्षसमेत रहेका नेकपा एमालेका उम्मेदवार शेरबहादुर लिम्बूलाई १ सय ९५ मतले पराजित गरे। विजयी सुब्बाले ४ हजार ३ सय ५९ मत र पराजित लिम्बूले ४ हजार १ सय ६४ मत प्राप्त गरे। त्यस्तै गाउँपालिकाको उपाध्यक्षमा गठबन्धनतर्फबाट उम्मेदवार नेकपा माओवादी केन्द्रकी गिता खेवा गुरुङ विजयी भइन्।

उनले नेकपा एमालेकी उम्मेदवार गोमा कार्की दाहाललाई ६ सय ९६ मतले पराजित गरिन्। गुरुङले ४ हजार ३ सय ८७ र पराजित कार्कीले ३ हजार ६ सय ९१ मत प्राप्त गरे। उपाध्यक्षमा विजयी गुरुङ नेकपा माओवादी केन्द्रका नेता तथा पूर्वअर्थराज्य मन्त्री स्वर्गीय हरिराज खेवाको श्रीमतीसमेत हुन्। गत २०७४ सालको स्थानीय तह निर्वाचनमा माओवादीको तर्फबाट गाउँपालिकाको उपाध्यक्षको उम्मेदवार बनेकी उनी नेकपा एमालेकी उम्मेदवार भीमकला श्रेष्ठसँग १ हजार २ सय १६ मतले पराजित भएकी थिइन्। त्यो बेला गुरुङले २ हजार ७३ र श्रेष्ठले ३ हजार २ सय ८९ मत प्राप्त गरेका थिए। ;

गाउँपालिकाका वडाहरुमा गठबन्धनको वर्चश्व रह्यो। ६ वडामध्ये गठबन्धनले ४ वडामा जीत हासिल गर्दा नेकपा एमालले २ वडामा मात्रै विजय हासिल गर्न सफल भयो। अघिल्लो स्थानीय तह निर्वाचनमा नेकपा एमालेले ६ मध्ये ५ वडा जितेको थियो। गठबन्धनको तर्फबाट वडाध्यक्षमा उम्मेदवार वनेका वडा नं १ मा गोविन्द लिम्बू, वडा नं. २ मा कृष्णसारु मगर, वडा नं. ५ मा डिकबहादुर लिम्बू, वडा नं. ६ मा दिपक गुरुङ विजयी भए। त्यस्तै नेकपा एमालेको तर्फबाट उम्मेदवार बनेका वडा नं. ३ मा ज्ञानबहादुर लिम्बू, वडा नं ४ मा टेकबहादुर तामाङले मात्रै जित हासिल गरे। ;

अर्घाखाँची : अर्घाखाँचीको पाणिनी गाउँपालिकामा नेकपा एमालेका टेकराज न्यौपाने विजयी भएको छन्। पाणिनी गाउँपालिकामा अध्यक्ष पदमा नेकपा एमालेबाट टेकराज न्यौपानेले ७ हजार ७४९ मत लिएर विजयी भएका हुन्। ;

नेपाली कांग्रेसका अच्युत गौतमले ७ हजार २८ मत लिएर प्रराजित भए। उपाध्यक्ष पदमा पनि एमालेकै नर्मदा पौडेल ७ हजार ६६१ मतसहित विजयी भएकी छन्। ;

यहाँ एमालेले सुरुबाटै अग्रता बनाएको थियो। कांग्रेसकी लक्ष्मी गौतमले ७ हजार ३८ मत लिएर प्रराजित भइन्।

सिमरा : बाराको जीतपुर-सिमरा उपमहानगर पालिकामा मतगणना जारी छ। हालसम्म उक्त नगरको वडा नम्बर १, २२, २३, २४ को मतगणना सकिइसकेको छ। ;

जीतपुर-सिमरा उपमहानगरको मेयर पदमा माओवादीका ;राजन पौडेलले लिड गरिरहेका छन्। उनले हालसम्म ३ हजार ८५९ मत प्राप्त गरेका छन्। उनलाई पछ्याउँदै एमालेतर्फकी सरस्वती चौधरीले ३ हजार ५५ मत प्राप्त गरेकी छन्। साथै हालसम्म लोसपाका सञ्जयकुमार साहले १ हजार २४७ मत प्राप्त गरेका छन्।

उपमेयर पदमा पनि हालसम्म कडा प्रतिस्पर्धा देखिन्छ। उपमेयरमा गठबन्धनतर्फकी मेघा शाहीले ३ हजार ६०१ मत प्राप्त गरेकी छन् भने एमालेका भोला अधिकारीले ३ हजार २८१ मत प्राप्त गरेका छन्। लोसपाका बीपी मोक्तानले हालसम्म  ;१ हजार २२३ मत प्राप्त गरेका छन्। ;

वडा नम्बर १ मा कांग्रेसको प्यानल नै विजयी भएको छ। त्यस्तै वडा नम्बर २२ मा पनि कांग्रेसको प्यालनले नै जीत हात पारेको छ। ;

वडा नम्बर २३ मा एमालेको प्यानल र २४ मा दलिततर्फका वडा सदस्यबाहेकको अरु पदमा कांग्रेस विजयी भएको छ।  ;त्यस्तै वडा नम्बर २ र ३ मा मतगणना  ;जारी छ। दुई वडाको अहिलेसम्मको परिणाम हेर्दा एमाले अगाडि देखिएको छ।

डडेलधुरा : नेपाली कांग्रेसका सभापति एवम् प्रधानमन्त्री शेरबहादुर देउवाको वडामा वीपी कांग्रेस विजयी भएको छ । गन्यापधुरा गाउँपालिका १ मा वीपी कांग्रेसका उम्मेदवार नरेश भण्डारी अध्यक्षमा निर्वाचित भएका हुन् ।

यो क्षेत्रमा कांग्रेस वीपी र नेकपा एमालेबीच चुनावी तालमेल भएको थियो । वडाध्यक्षमा निर्वाचित भण्डारीले ३५ मत अन्तरले जितेका हुन् । यस्तै, गन्यापधुरा ३ र ४, अमरगढी १ मा कांग्रेसले जितेको छ । प्रधानमन्त्री देउवाले असीग्राम मावी रुवाखोलाबाट मतदान गरेका थिए । ;

आल्लिताल गाउँपालिकाको १ मा एमाले र परशुराम १ मा  ;माओवादीले जित हाँसिल गरेको छ।

काठमाडौं : नेपाली कांग्रेस चितवनका निवर्तमान सभापति जीतनारायण श्रेष्ठले भरतपुर महानगरमा पाँच दलीय गठबन्धनको जित सुनिश्चित भएको बताएका छन् । चितवनको भरतपुर महानगरमा सत्ता गठबन्धनको सभामा बोल्दै श्रेष्ठले पाँच दलीय गठबन्धनले जित्ने कुरामा विश्वस्त हुन आग्रह समेत गरे।

 ;२९ वटै वडामा गठबन्धनलाई विजयी बनाउन अघि बढ्ने बताए । उनले भने,' रेणु दाहाललगायत सिंगो गठबन्धनलाई जिताउन प्रतिवद्धता व्यक्त गर्छौं । यसो भन्दै गर्दा आदरणीय पुष्पकमल दाहाललाई भन्नैपर्छ हाम्रो पार्टीको सोझो सभापति हुनुहुन्छ । भोलिको दिनमा ढाँट्ने काम नहोस्।'

जीतनारायण रेणु दाहालका कट्टर आलोचक हुन् । उनले रेणुलाई मेयरमा समर्थन गर्न नसकिने बताउँदै आएका थिए । ;

सिमरा : बाराको दुई उपमहानगरपालिकामध्ये कलैया उपमहानगरपालिकाको नगर प्रमुख (मेयर) पदमा नेकपा एमालेले विनोद साहलाई उम्मेदवार बनाउने भएको छ। एमालेको केन्द्रीय सचिवालयको बैठकले शनिबार देशका नौ उपमहानगरपालिकाको उम्मेदवार टुंगो लगाउने क्रममा साहलाई पुनः कलैयाको उम्मेदवार बनाउने निर्णय गरेको हो। ;

एमाले बाराका अध्यक्षसमेत रहेका साहलाई एमालेले अघिल्लो स्थानीय तहको निर्वाचनमा पनि कलैया उपमहानगरमा प्रमुख पदको उम्मेदवार बनाएको थियो। २०७४ सालको उक्त निर्वाचनमा साह नेपाली कांग्रेसका उम्मेदवारसंग कम मतान्तरले पराजित भएका थिए। ;

कांग्रेसका राजेश राय यादवले दस हजार नौ सय तीन मत प्राप्त गर्दै जित हात पारेको उक्त निर्वाचनमा साहले दस हजार सात सय १६ मत ल्याएका थिए। अघिल्लो निर्वाचनमा दोस्रो भएका साह यसपटक पनि एमालेको बलियो उम्मेदवारको रुपमा चर्चामा रहदै आएका थिए। ;

उपमहानगरपालिकाको प्रमुख पदका लागि साहसहित रविनदास श्रेष्ठ, कलामुद्धिन अंसारी र भवानी दुलालको नाम सिफारिस भएको थियो। प्रमुख पद टुंगाएको एमालेले उपप्रमुख पदमा भने निर्णय गर्न बाकी राखेको छ। उपप्रमुख पदका लागि चार जनाको नाम सिफारिस भएको छ। ;

जीतपुरसिमरा अझै टुंगिएन
अत्यन्तै चासोका साथ हेरिएको जिल्लाको अर्को उपमहानगरपालिका जीतपुरसिमराको उम्मेदवार भने एमालेले टुंगाउन बाँकी राखेको छ। लामो समयको छलफलमा पनि एमालेले जीतपुरसिमराको विषयमा टुंगो लगाउन नसकेको हो। ;

जीतपुरसिमरा उपमहानगरपालिकाको प्रमुख पदका लागि १० र उपप्रमुख पदका लागि पाँच जनाको नाम सिफारिस भएको थियो। प्रमुख पदका लागि नगर उपप्रमुख सरस्वती चौधरीसहित एमाले बारा सचिवालय सदस्य मनोज पौडेल, जिल्ला कमिटी सदस्य कासिम हुसेन, नारायण क्षेत्री, भरत घले, अनिल मैनाली, राधेश्याम सिवाकोटी, महादेव चौधरी, प्रलाद साह र विश्वनाथ लामिछानेले दाबी गरेका छन्। ;

यसैगरी उपप्रमुखमा भोला अधिकारी, कमला घिमिरे, रेनु रिमाल, सरिता चौधरी, अशोक लामाले आकांक्षा देखाएका छन्। ;

सिमरा : स्थानीय तहको निर्वाचनको लागि जीतपुरसिमरा उपमहानगरपालिकामा बिहीबार निर्वाचन अधिकृतको कार्यालय स्थापना गरिएको छ । उपमहानगरपालिकाको कार्यालयमा निर्वाचन अधिकृत टिकामणी न्यौपानेको कार्यालय स्थापना गरिएको हो । ;

वैशाख ३० गतेका लागि तोकिएको निर्वाचन प्रक्रिया सम्पन्न गर्न अधिकृत न्यौपाने जीतपुरसिमरा आएका छन् । दुई दिन बारा आएका न्यौपानेले प्रमुख जिल्ला अधिकारी कृष्णबहादुर कटुवाल, प्रमुख निर्वाचन अधिकृत खिलनाथ रेग्मीसंग छलफल गरेपछि  ;कार्यालय स्थापना गरेका हुन् । ;

न्यौपानेलाई जीतपुरसिमराका उपमहानगरपालिकाका प्रमुख प्रशासकीय अधिकृत चेतकुमार पोखरेलले स्वागत गरेका थिए । निर्वाचन अधिकृतको कार्यालय स्थापना भएसंगै अधिकृत न्यौपानेले निर्वाचन कार्यतालिका सार्वजनिक गरेका छन् । ;

अधिकृत न्यौपानेले जीतपुरसिमराको निर्वाचन प्रक्रियालाई विवादरहित ढंगबाट सफल बनाउनका लागि तयारी सुरु गरिएको बताए । अधिकृत न्यौपानेले निर्वाचनको तयारीका लागि शुक्रबार राजनीतिक दलहरुबीच छलफल गर्ने भएका छन् । ;

सिमरा : नेपाली कांग्रेसले जीतपुरसिमरा उपमहानगरपालिकामा केन्द्रीय गठबन्धनको निर्णय नस्वीकार्ने भएको छ । केन्द्रीय गठबन्धनले प्रमुख पद नेकपा माओवादी केन्द्रलाई दिने निर्णय गरेपछि कांग्रेसले उक्त निर्णय अस्वीकार ;गर्ने बताएको हो।

केन्द्रीय गठबन्धनबीच भएको भागबण्डामा जीतपुरसिमराको प्रमुख पद माओवादी र उपप्रमुख पद कांग्रेसलाई दिने गरी सहमति भएको थियो । गठबन्धनबीच भएको भागबण्डाको निर्णय बाहिर आएपछि कांग्रेसले नगरस्तरीय बैठक बोलाएर दुवै पदमा एक्लै प्रतिस्पर्धा गर्ने निर्णय गरेको हो । ;

गठबन्धनको निर्णय पर्खेर बसेको कांग्रेसले अन्ततः उपमहानगरपालिकाको प्रमुख र उपप्रमुख पदको आकांक्षीको नाम सिफारिस गरेको छ। कांग्रेस नगर समितिको बैठकले प्रमुखमा ११ र उपप्रमुखमा १३ जनाको नाम सिफारिस ; ;गरेको हो । ;प्रमुख पदका लागि श्यामबाबु गुप्ता, कृष्णवर्त सिंह, नारायणी रायमाझी, शोभाकर पराजुली, ओमकृष्ण कार्की, सुमनकुमार भट्टराई, टिकाराम पौडेल, माधव उपाध्याय, रुद्र पौडेल, देवेन्द्र उपाध्याय र गंगा काफ्ले आकांक्षी देखिएका छन् । ;

यसैगरी उपप्रमुख पदका लागि गिता शर्मा, राधादेवी साह, मेघा शाही, रिता रिजाल, रामबाबु गुप्ता, छविलाल शर्मा, रेशम तिवारी, शरदचन्द्र भट्टराई, राजमणि बराल र श्यामबाबु सिंह भूमिहारले दावी गरेका छन् । दुवै पदमा दावी गरेका सबैको नाम सिफारिस गर्ने निर्णय भएको नगर सभापति छविलाल शर्माले जानकारी दिए । ;

उनले केन्द्रीय गठबन्धनको निर्णय अमान्य रहेको र कांग्रेसले दुवै पदमा एक्लै प्रतिस्पर्धा गर्ने बताए । 'हामीलाई गठबन्धनको निर्णय स्वीकार्य छैन्, हामी एक्लै चुनाव लड्न सक्षम छौं, शर्माले भने,'त्यसैले हामीले आफ्नो प्रक्रिया अगाडि बढाएका छौं । '

अघिल्लो स्थानीय तहको निर्वाचनमा दोस्रो भएको कांग्रेसले प्रमुख पदमा दावी गर्दै आएको थियो । नेकपा एमालेले प्रमुख र उपप्रमुख दुवै पदमा जित हात पारेको जीतपुरसिमरामा कांग्रेस दोस्रो र माओवादी तेस्रो भएको थियो । गठबन्धनबीच भागबण्डाको विषयमा छलफल सुरुवात भएलगत्तै कांग्रेस नगर कार्यसमितिले प्रमुख पदमा आफ्नो दावी रहेको र उक्त पद नपाए एक्लै चुनाव लड्ने निर्णय गर्दै केन्द्रमा पत्राचार गरेको थियो । ;

काठमाडौँ : ;ललितपुर वुमन्स च्याम्पियनशिपमा सुदूरपश्चिम प्रदेशले ललितपुर मेयर्स–११ लाई पराजित गर्दै प्रतियोगितामा विजयी सुरुआत गरेको छ। ;

कीर्तिपुरस्थित त्रिवि क्रिकेट मैदानमा आज भएको पहिलो खेलमा ललितपुर मेयर्स–११ लाई ५८ रनले पराजित गर्दै सुदूरपश्चिमले विजयी सुरुआत गरेको हो। १४४ रनको लक्ष्य पछ्याएको मेयर्स–११ ले निर्धारित २० ओभरमा ७ विकेट गुमाउँदै ८५ रन मात्र जोड्न सक्यो। मेयर्स–११ का लागि सरस्वती चौधरीले सर्वाधिक २६ रन जोडिन् भने साना प्रवीनले १५ रनको योगदान गरिन्। कञ्चन श्रेष्ठ १० रनमा आउट भइन्। सुदूरपश्चिमका लागि लक्ष्मी साउदले सर्वाधिक ३ विकेट हात पारिन् भने कविता कुवँरले दुई विकेट लिइन्। ईश्वरी विष्ट र सम्झना खड्काले एक–एक विकेट लिए। ;

त्यसअघि टस जितेर पहिले ब्याटिङ गरेको सुदूरपश्चिमले निर्धारित २० ओभरमा ५ विकेट गुमाउँदै १४३ रनको योगफल बनाएको थियो। सुदूरपश्चिमका लागि कप्तान रितु कनौजियाले सर्वाधिक ४२ रनको योगदान गरिन्। रितुले २९ बल खेल्दा ६ चौका प्रहार गरिन्। त्यसैगरी रेवती ढकालले २९, विन्दु रावलले २८ तथा डोली भट्टले २५ रन जोडे। मेयर्स–११ का लागि खुसी डङ्गोलले सर्वाधिक २ विकेट लिइन् भने अनुराधा चौधरी, आरती विडारी र अस्मिना कर्माचार्यले एक–एक विकेट लिए।

प्रतियोगितामा प्रदेश नं १, सशस्त्र प्रहरी बल ९एपिएफ०, लुम्बिनी प्रदेश, सुदूरपश्चिम प्रदेश र आयोजक ललितपुर गरी पाँच टोलीको सहभागिता रहेको छ । ;
